libs.content:
find_library(
  freeglut_library
  names freeglut_static freeglut glut
  path
    /opt/local/lib
    ${cmake_library_path}
    $env{lib}
    /usr/lib
    /usr/local/lib
)

find_library(
  genapi_library
  names genapi_gcc40_v2_4 genapi_gcc43_v2_4 genapi_md_vc80_v2_4
  hints ${pc_genapi_library_dir}
  path ${genapi_search_paths}
)

find_library(pastix_${pastix_lib}_library
	names ${pastix_lib}
	hints ${pastix_dir}
	path_suffixes lib lib32 lib64)

find_library( glew_glew_library
      names glew glew32
      paths
      $env{glew_root_path}/lib
      ${opengl_library_dir}
    )

find_library(scotch_${scotch_lib}_library
	names ${scotch_lib}
	hints ${scotch_dir}
	path_suffixes lib lib32 lib64)

find_library(computecpp_runtime_library computecpp paths ${computecpp_package_root_dir}
  hints ${computecpp_package_root_dir}/lib path_suffixes lib
  doc "computecpp runtime library" no_default_path)

find_library(ptscotch_${ptscotch_lib}_library
	names ${ptscotch_lib}
	hints ${ptscotch_dir}
	path_suffixes lib lib32 lib64)

find_library(glog_library names glog
    hints ${glog_library_dir_hints}
    paths ${glog_check_library_dirs}
    path_suffixes ${glog_check_library_suffixes})

find_library(cxsparse_library names cxsparse
  hints ${cxsparse_library_dir_hints}
  paths ${cxsparse_check_library_dirs}
  path_suffixes ${cxsparse_check_path_suffixes})
